import React, { useState } from 'react'

const Map = props => {
  const map = (
      new window.google.maps.Map(document.getElementById('map'), {
      center: {lat: -34.397, lng: 150.644},
      zoom: 8,
      })
  )



  return (
    <div id="google-map">
      { map }
    </div>
  )
}

export default Map
